import React from 'react';
import { Link } from 'react-router-dom';

export default function Navbar(){
  return (
    <nav className="bg-white shadow sticky top-0 z-10">
      <div className="container mx-auto flex items-center justify-between p-4">
        <Link to="/" className="text-2xl font-bold text-indigo-600">Book<span className="text-pink-500">Shelf</span></Link>
        <div className="flex items-center gap-4">
          <Link to="/items" className="text-sm font-medium text-gray-700 hover:text-indigo-600">Books</Link>
          <Link to="/add-item" className="px-3 py-2 bg-indigo-600 text-white rounded hover:bg-indigo-500">Add Book</Link>
        </div>
      </div>
    </nav>
  );
}
